import React from "react";
import { Card, Col, Row } from "react-bootstrap";
import img1 from '../imag/img1.jpg'
const Cardse = ({itemsData}) => {
  return (
    <Row>
      {
        itemsData.leng
      }
        <Col sm='12'  className="my-1" >
          <Card className="d-flex flex-row">
            <Card.Img className="img-item" variant="top" src={img1} />
            <Card.Body>
              <Card.Title>
                <div className="d-flex justify-content-between">
                  <div className="item-title">وجبة فطار</div>
                  <div className="item-price">13$</div>
                </div>
              </Card.Title>
              <Card.Text className="py-2">
                <div className="item-description">
                  وصف وجبة الفطار وصف وجبة الفطار وصف وجبة الفطار وصف وجبة الفطار
                </div>
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
    </Row>
  );
};

export default Cardse;
